// FICHIER DE SURCHARGE

@import './ieps_framework/index.scss';

body {
    background: linear-gradient(to bottom, $color-1, 5%, $color-2);
}

//MAIN HEADER
.main-header {
    a {
        color: $color-neutral-4;
    }
    nav {
        background: radial-gradient($color-1 50%, $color-neutral-3);
    }
    &.logo-link {
        text-decoration: none;
        display: block;
        width: 200px;
        border: 4px solid $color-neutral-4;
        margin: auto;
        padding: 0.5rem;
        margin: 4rem auto 2rem auto;
    }
}

//MAIN CONTENT
.main-content {
    background: $color-neutral-4;
    padding: 8rem 8rem 6rem 8rem;
}

//MAIN FOOTER
.main-footer {
}

