//DEFINITION DE L'ETIQUETTE CONTAINER

//BOUCLE DES MEDIAS QUERIES
@use "sass:map";

@each $size, $values in $screen-sizes {
    @media screen and (min-width: map-get($values, 'breakpoint')) {
        .container {
            width: 100%;
            max-width: map-get($values, 'container-size');
            margin: auto;
        }
    }
}

//-------------------------------
//CONTENT ALIGNMENTS
//-------------------------------

.text-center {
    text-align: center;
}

.text-left {
    text-align: left;
}

.text-right {
    text-align: right;
}

.text-justify {
    text-align: justify;
}

//-------------------------------
//FLOAT ALIGNMENTS
//-------------------------------

.float-left {
    float: left;
}

.float-right {
    float: right;
}

//-------------------------------
//BOX SPECIFICATIONS
//-------------------------------
.box {
    font-weight: 200;
    border: 2px solid $color-neutral-5;
    padding: 1rem;
    line-height: 2rem;
}

// -------------------------------------------------------------------
// DISPLAY
// -------------------------------------------------------------------

/* Valeurs de type <display-outside> */
.display {
    &.-block {
        display: block;
    }
    &.-inline {
        display: inline;
    }
    &.-run {
        display: run-in;
    }

    /* Valeurs de type <display-inside> */
    &.-flow {
        display: flow;
    }
    &.-flow-root {
        display: flow-root;
    }
    &.-table {
        display: table;
    }
    &.-flex {
        display: flex;
    }
    &.-grid {
        display: grid;
    }
    &.-ruby {
        display: ruby;
    }

    /* Combinaison de valeurs */
    /* <display-outside> et <display-inside> */
    &.-block-flow {
        display: block flow;
    }
    &.-inline-t {
        display: inline table;
    }
    &.-flex-run {
        display: flex run-in;
    }

    /* Valeurs de type <display-listitem> */
    &.-list-item {
        display: list-item;
    }
    &.-list-item-block {
        display: list-item block;
    }
    &.-list-item-inline {
        display: list-item inline;
    }
    &.-list-item-flow {
        display: list-item flow;
    }
    &.-list-item-f-r {
        display: list-item flow-root;
    }
    &.-list-item-block-f {
        display: list-item block flow;
    }
    &.-list-item-block-f-r {
        display: list-item block flow-root;
    }
    &.-list-item-f-block {
        display: flow list-item block;
    }

    /* Valeurs de type <display-box> */
    &.-contents {
        display: contents;
    }
    &.-none {
        display: none;
    }

    /* Valeurs de type <display-legacy> */
    &.-inline-block {
        display: inline-block;
    }
    &.-inline-table {
        display: inline-table;
    }
    &.-inline-flex {
        display: inline-flex;
    }
    &.-inline-grid {
        display: inline-grid;
    }

    /* Valeurs globales */
    &.-inherit {
        display: inherit;
    }
    &.-initial {
        display: initial;
    }
    &.-unset {
        display: unset;
    }
}
//-------------------------------
//JUSTIFY ALIGNMENTS
//-------------------------------

.justify {
    &.center {
        justify-content: center;
    }

    &.space-between {
        justify-content: space-between;
    }

    &.space-around {
        justify-content: space-around;
    }

    &.space-evenly {
        justify-content: space-evenly;
    }
}

